import React from 'react';
import './App.css';

function App() {
  return (
    <svg id="arrow-svg-1" xmlns="http://www.w3.org/2000/svg" width="80pt" viewBox="0 0 48 80" version="1.1">
        <g id="surface1">
          <path style="fill:none;stroke-width:2;stroke-linecap:butt;stroke-linejoin:miter;stroke: #f4c7c8;stroke-opacity:1;stroke-miterlimit:4;" d="M 1 1 L 9.835938 9.835938 L 1 18.670898 " transform="matrix(4,0,0,4,0,0)"/>
        </g>
      </svg>
);
}

export default App;
